    java.setContent(vol);
    var volInfo = 'ç®€ä»‹ï¼š' + NL + java.getStringList(rules.volInfo).toArray().join(NL);
    var chs = java.getElements(rules.chapters).toArray().map(ch => {
      java.setContent(ch);
      var isVip = !java.getElements(rules.vip).isEmpty();
      var chName = java.getString(rules.chName);
      return {
        text: (isVip ? 'âœ¿Â·' : '').padStart(0, "\u2000")+(opts.showVolName ? volsName[idx]+"\x20" : '')+chName,
        href: java.getString(rules.chLink),
        name: chName

      };
    });

    volInfo += NP + 'ç›®å½•(' + chs.length + ')ï¼š' + NL;
    volInfo += chs.slice(0,10).map(v => v.name).join(NL);
    volInfo += chs.length > 10 ? NL + 'â€¦â€¦' : '';
    volInfo = volInfo.replace(/(\s)\1+/g, '$1');
    list.push({
